description:
There's something off about the new secretary at Mr. Eliot's import/export business. She's kind, eager to please, and extremely sexy, but can she be trusted? Meanwhile, Clarke, the number two man at the company, is plotting his own little business with his sexy secret girlfriend who happens to be the old secretary. Will the new secretary seduce Clarke to reveal his plans, or will she be seduced by the boss who has his own haunted sexual history. Starring the amazing, award-winning Asa Akira, Sweet Sinner brings you James Avalon's The Secretary Volume 3!

